const RegistrationWithInput = ({ inputProps, onInputChange, ...props }) => {
  debugger;

  const getInputTextTypeDom = () => {
    return (
        <div>
          <lable>{inputProps?.[value]?.lable}</lable>
          <input
            type={inputProps?.[value]?.inputType}
            onChange={onInputChange}
            name={inputProps?.[value]?.tagName}
          />
        </div>
      );
  }
  const getRadioButtonTypeDom = () => {
    return (
        <div>
          <lable>{inputProps?.[value]?.lable}</lable>
          <input
            type={inputProps?.[value]?.inputType}
            onChange={onInputChange}
            name={inputProps?.[value]?.tagName}
          />
        </div>
      );
  }
  return (
    <div>
      <div>
        {Object.keys(inputProps).map(value => {
          return (
            <div>
                {
                 inputProps?.[value]?.type ==   "editableText" ?  getInputTextTypeDom(value) : inputProps?.[value]?.type == "editableRadioButton" && getRadioButtonTypeDom(value)
                }
              {/* <lable>{inputProps?.[value]?.lable}</lable>
              <input
                type={inputProps?.[value]?.inputType}
                onChange={onInputChange}
                name={inputProps?.[value]?.tagName}
              /> */}
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default RegistrationWithInput;
